import { Route, Switch } from "react-router-dom";
import AllQuote from "./pages/AllQuote";
import QuoteDetail from "./pages/QuoteDetail";


function App() {
  return (
    <Switch>
      <Route path="/quotes">
        <AllQuote />
      </Route>
      <Route path="/quotes/:quoteId">
        <QuoteDetail />
      </Route>
    </Switch>
  );
}

export default App;
